import React from "react";
var Fontawsome = require("react-fontawsome");

function MovieList(props) {
  const movieClicked = (movie) => (eve) => {
    props.movieClicked(movie);
  };
  const movieDelete = (movie) => (eve) => {
    props.movieClicked(movie);
  };
  return (
    <div>
      {props.movies.map((movie) => {
        return (
          <div key={movie.id}>
            <h3 onClick={this.movieClicked(movie)}>{movie.title}</h3>
            <Fontawsome name="edit" />
            <Fontawsome name="trash" onClick={this.movieDelete(movie)} />
          </div>
        );
      })}
    </div>
  );
}
export default MovieList;
